How to get list of documents in the collection till where the sum of 'cost' field has reached a specific value (mongoDb)?<p>I have a collection:</p>

<pre><code>[
 {
  _id:1,
  dish:pizza,
  cost:52
 },
 {
  _id:2,
  dish:burger,
  cost:33,
 },
 {
  _id:3,
  dish:sandwich,
  cost:64,
 }
 {
  _id:4,
  dish:noodles,
  cost:23
 },
]
</code></pre>

<p>I have a budget set equal to some value say 60.</p>

<p>Is it possible to <code>sort</code> the dishes by <code>cost</code> in <code>asc</code> order and get first n number of documents where sum of costs is less than or equal to 60?</p>

<p>here: cost of 23(noodles)+33(burger)&lt;=60, so these 2 documents are fetched.</p>

<p>output should be:</p>

<pre><code>[
 {
  _id:4,
  dish:noodles,
  cost:23
 }, 
 {
  _id:2,
  dish:burger,
  cost:33,
 }
]
</code></pre>

