Embed Field: mongoose - aggregating data<p>I'm trying to figure out how to use <code>aggregate</code> with mongoose with the following code below: </p>

<pre><code>    const Model = db.model(which, schema)
    var regex = new RegExp(name, "g")
    const query =
        Model
            .find({
                name: regex
            })
            .where("user_id").equals(req.session.user.id)

    if (except) 
    {
        if (Array.isArray(except))
        {
            query
                .where("_id").nin(except)
        }
        else 
        {
            query
                .where("_id").neq(except)
        }
    }  

    return await
        query
            .skip(start)
            .limit(finish)
            .lean()
            .exec()
</code></pre>

<p>What I'm trying to do is get the total (that wasn't limited) as well. Of course I could remove <code>skip</code> and <code>limit</code> and use <code>count</code>, and run it a second time, but I think aggregate is suitable in this situation?</p>; Answer: If your `root` is `NULL`, then the program will never enter the `while` loop, resulting in `prev` never being assigned and a `NULL` pointer being dereferenced in this statement: `if(prev->data >= value)`

