Grails GORM hasMany association inconsistent with MongoDB, When try to fetch child Records,it fetches the record sometimes and doesn't fetch sometimes<p>Below is the domain class <code>Author</code> which has a one-to-many association with <code>Book</code>. When trying to fetch Author, sometimes will get the associated collection of <code>Book</code> domain object and sometimes returns null. Any thoughts on why it is inconsistent?</p>

<p><code>class Author {
    static mapWith = "mongo"
    String name
    static hasMany = [books: Book]
}</code></p>

<p>_author.gson</p>

<p><code>model {
    Author author
}
</code>
<code>
json g.render(author]) {
    books g.render(author.books)
}</code></p>

<p>Environment details:</p>

<p><code>grailsVersion=3.3.5
gormVersion=6.1.8.RELEASE</code></p>

